'use strict';

var 														// Totem modules
	ENUM = require("../enum"),
	STREAM = require("stream");
	
var															// shortcuts
	Copy = ENUM.copy,
	Each = ENUM.each;

var LOG = console.log;

class RAN {
	
	constructor(opts) {
		Copy({  // default configuration

			// inputs held fixed as process evolves
			
			N: 0, 		// ensemble size
			A: null,	// process parameters: [dims, units, or range]
				// [KxK] generate K-state process with jump rate matrix [from, to]
				// {Tc,p} generate K=2 state process with prescribed coherence time and on-state probability
				// {alpha,beta} generate K=2 state process with prescribed rates
				// {n} generate K-state process with n=K^2-K unqiue random rates
				// {K} generate K-state process with n=K^2-K unqiue random rates
				// {dt,n,agent,fetch,quantize} real-time process at prescribed sampling time dt[s] having n-rates

			batch: 20, 	// number of steps to batch before stats updated
			//Amle: null,  // mle of A: [dims, units, or range]
			sym: null, 	// [K] state symbols (default = 0:K-1)
			nyquist: 10, // nyquist oversampling rate
			wiener: 0,  // number of additional random walks at each wiener step
			reversible: false,  // tailor A to make process reversible	
			bins: 0,  // number of bins for ensemble activity histogram
			jumpModel: "poisson",   // typically not used
			intervals: 10, // maximum number of coherence intervals to write streams

			filter: function (str,ev) {  //< streaming filter to modify an event destined for the event stream
				switch ( ev[0] ) {
					case "jump":
						str.push( ev );
						break;
				}
			},

			store: null,   //< [] || null to make event pipe() stream sync || async
			events: null, 	//< [...] || null to place process in realtime || simulation mode
			
			// updated as process evoloves

			// wiener process: [dims, units, or range]
			WU: null, 		// [N] wiener ensemble
			WQ: null, 		// [N] wiener cummulative walk ensemble

			// markov process: [dims, units, or range]
			K: 0, 		// #states >= 1 inferred from supplied A rates
			U: null,    // [N] ensemble states [0:K-1] at time t
			U0: null, 	// [N] ensemble states [0:K-1] at time t = 0
			H: null, 	// [N] ensemble next jump time [s]
			R: null, 	// [KxK] from-to holding times  [s]
			T: null, 	// [KxK] from-to time in state [s]
			P: null,	// [KxK] from-to cummulative transition probabilities
			ZU: null, 	// [KxK] from-to samples-in-state probabilities
			pi: null, 	// [K] initial state probabilities (default = 1/K)
			//piEq: null, 	// [K] equilibrium  state probabilities
			NU: null, 	// [K] count of ensemble in state [1:N]

			// two-state markov parameters

			alpha: 0,  // on-to-off rate [jumps/s]
			beta: 0,  // off-to-on rate [jumps/s]
			p: 0,  // on state pr 
			q: 0,  // off(not on) state pr 

			// K-state parameters

			lambda: 0,  // average jump rate [jumps/s]
			Tc: 0,  // coherence time >0 [s] 
			dt: 0, // sample time [s]
			t: 0, // step time [s]

			steps: 0, // number of steps 
			jumps: 0, // number of jumps
			samples: 0, // number of elements scanned
			realtime: null // realtime process parameters

		}, this);

		if (opts) this.config(opts);
	}
	
	jump (fr, cb) {   // compute to-state via fr-state with callback cb(to-state, next holding time)
		
		var 
			K = this.K, R = this.R, P = this.P, A = this.A;

		switch (this.jumpModel) {  // reseed jump rates if model requires
			case "gillespie":  // reseed using Gillespie model (use at your own risk)
				Gillespie( this.dt, fr, P, R );
				break;
				
			case "poisson": // Poisson already seeded
			default:
				break;
		}

		if (K == 2)  // get new state for the 2-state process
			to = (fr + 1) % 2;
		
		else do { 	// get new state by taking a random jump according to cummulative P[fr,to]
			for (var Pfr = P[fr],u=Math.random(),to=0; to < K && Pfr[to] <= u; to++) ;
		}
		
		while (fr == to);

		this.jumps++;  // increase jump counter
		cb( to, R[fr][fr] = expdev( R[fr][to] ) );  // draw and store new exptime
	}
	
	end() {  // save metrics when process terminates
		this.mleTc = this.corrTime();
		this.onEnd();
	}
	
	step (evs) {  // step process with callback to onStep
		var 
			ran = this,
			U=this.U,H=this.H,R=this.R,U0=this.U0,T=this.T,ZU=this.ZU,K=this.K,NU=this.NU, //KU=this.KU,
			//jump = this.jump, onJump = this.onJump,
			t = this.t, dt = this.dt, N=this.N;
		
		setvector(NU,0);   // clear state counter
		
		this.samples += N; 
		this.gamma[this.steps] = this.corr();

		/* for (var k=0; k<K; k++)  NU[k] = 0;    */
		
		/*
		if (rt = this.realtime)  // realtime process
			rt.fetch(rt.agent, function (events) {  // fetch events
				events.each(function (k,event) {  // process an event
					rt.quantize(event, function (state,n) { // get its state and ensemble index
						var fr = U0[n], to = U[n];
						
						if ( to != state ) {  // state changed so force a jump
							onJump(n,to,state,0); 	// callback with jump info
							
							to = state;  // new state
							T[ fr ][ to ] += t - H[n];  // advance cummulative time-in-state  
							U[ n ] = to;	// set state
							H[ n ] = t;	// mark jump time
						}
						
						ZU[ fr ][ to ]++;  // step samples-in-state counter
						NU[ to ]++; 		// step number in state						
					});
				});				
			});  
	
		else // simulated process
		*/
		if (evs) // realtime mode
			evs.each(function (n,ev) {
				var 
					n = ev.n,
					fr = U0[n], 
					k = U[n],
					t = ev.t,
					to = ev.u;
				
				//LOG(n,k,fr,to,t,H[n]);
				
				if (k != to) {
					ran.onJump(n,k,to,0); 	// callback with jump info
					T[ fr ][ to ] += t - H[n]; 	// advance cummulative time-in-state  
					U[ n ] = to;  		// set state
					H[ n ] = t;			// hold jump time
				}

				ZU[ fr ][ to ]++;  // increment samples-to-state counter
				NU[ to ]++; 		// increment number-in-state counter		
			});
			
		else  // simulation mode
			for (var n=0; n<N; n++)  { // scan the ensemble
				var fr = U0[n], k = U[n];
				
				if ( t >= H[n] )    // holding time exceeded so jump to new state
					ran.jump( k, function (to, h) {  // get new to-state and its holding time
						ran.onJump(n,k,to,h); 	// callback with jump info

						T[ fr ][ k ] += (t - H[n]) + h; 	// advance cummulative time-in-state  
						U[ n ] = to;  		// set state
						H[ n ] = t + h;    // advance to next-jump time 
						k = to;
					});

				ZU[ fr ][ k ]++;  // increment samples-to-state counter
				NU[ k ]++; 		// increment number-in-state counter
			} 			
			/*
			for (var n=0; n<N; n++)  { // scan the ensemble
				var fr = U0[n], to = U[n];
				
				if ( t >= H[n] )    // holding time exceeded so jump to new state
					ran.jump( to, function (state, h) {  // get new to-state and its holding time
						ran.onJump(n,to,state,h); 	// callback with jump info

						to = state;  // new state
						T[ fr ][ to ] += (t - H[n]) + h; 	// advance cummulative time-in-state  
						U[ n ] = to;  		// set state
						H[ n ] = t + h;    // advance to next-jump time 
					});

				ZU[ fr ][ to ]++;  // increment samples-to-state counter
				NU[ to ]++; 		// increment number-in-state counter
			} */
			
		if ( this.wiener ) {  // step wiener process
			var 
				M = this.wiener,
				floor = Math.floor, sqrt = Math.sqrt, 
				nrv = this.NRV.sample, WU = this.WU, WQ = this.WQ;
			
			for (var t=this.steps,n=0; n<N; n++) {				
				for (var sum=WQ[n], j=1, J=floor(M*t); j<=J; j++) sum += nrv()[0];
				WU[n] = sum / sqrt(M);
				WQ[n] = sum;
			}
		}
		
		/*for (var k=0; k<K; k++) {  // update cummulative counts
			KU[k] += NU[k];  
		} */
		
		//LOG(this.steps, this.gamma[this.steps]);
		this.activity.add( N - NU[0] );
		
		this.t += this.dt; this.steps++; this.ints += this.dint;
		this.onStep();
	}
		
	start ( ) {	  // advance process this.batch steps with callback to onBatch with batch metrics
		var 
			ran = this,
			exp = Math.exp, 
			log = Math.log;

		function evfeed(evs, dt, cb) {
			var n =0, t=0, evbuf = [], evStream = new STREAM.Readable({
				objectMode: true,
				read: function () {
					this.push( evs[n++] || null );
				}
			});
			
			for ( var ev = evStream.read(); ev; ev = evStream.read() ) {
				if (ev.t - t > dt ) {
					cb( evbuf ); evbuf = [ev]; t += dt;
				}
				else
					evbuf.push (ev );
			}
		}
					
		function poisson(m,a) {
			// a^m e(-a) / m!
			for (var sum=0,k=m; k; k--) sum += log(k);
			return exp( m*log(a) - a - sum );	
		}

		/*
		if (rt = this.realtime)  // realtime process
			rt.fetch(agent+"&session options", function (ack) {
				rt.tid = setInterval( function(rt) {  // set next data fetch time
					step();

					if (this.steps % steps == 0) 
						if ( !play(cb) )
							clearInterval(rt.tid);

				}, this.dt*1e3, rt);
			}); 
			
		else { // simulated process
		*/
		
		if ( this.events ) { // realtime mode
			LOG("FEED events");
			evfeed( this.events, this.dt, function (evs) {  // ingest a batch of events in next dt interval 
				ran.step(evs);
			});
			this.runSteps = this.steps;
			//this.end();
		}
		
		else
			for (var s=0, N = this.batch; s<N; s++) {
				//LOG(s,this.steps,this.runSteps);
				if ( this.steps < this.runSteps ) // simulation mode
					this.step(); 
		
				else
					this.end();
			}
		
		this.mleJumpRates();  // update estimated jump rates
		
		var	// update activity stats
			N0 = this.N * this.pi[0],  // average number in 0-state
			stats = [],
			act = this.activity;

		act.norm();

//Trace(["eq",this.piEq,avgcount]);

		for (var bin=0, bins=act.bins; bin<bins; bin++) {
			var count = act.count[bin];
			stats.push([ count, act.hist[bin], poisson(count,N0) ]);
		}

		this.onBatch(stats);
	}
	
	corr () {  // statistical correlation function
		var 
			K = this.K, sym = this.sym, cor = 0, ZU = this.ZU, N = this.samples, corr0=this.corr0;

		for (var fr=0; fr<K; fr++) 
			for (var to=0, Zfr=ZU[fr]; to<K; to++) 	{
				//LOG(this.steps,fr,to,sym[fr],sym[to],Zfr[to],N);
				cor += sym[fr] * sym[to] * Zfr[to] / N;
			}

		//LOG(this.steps, cor);
		return cor;
	}

	corrTime () {  // return correlation time computed as area under normalized auto correlation function
		var abs = Math.abs;
		for (var n=1, N = this.steps, Tc = 0; n<N; n++) Tc += abs(this.gamma[n]);
		
		Tc *= this.dt / this.gamma[0];
		//LOG("tc calc",N, Tc, this.gamma);
		return Tc;
	}
	
	mleJumpRates () {    // MLE jump rates
		var 
			K = this.K, T = this.T, dt = this.dt, A = this.A;  //piEq = this.piEq, 

		//for (var Tfr=T[fr], Tsum=0, to=0; to<K; to++) Tsum += Tfr[to];
		//for (var to=0; to<K; to++) cor += sym[fr] * sym[to] * Tfr[to] / Tsum;
		
		//for (var fr=0; fr<K; fr++) piEq[fr] = 0;
		
		for (var fr=0; fr<K; fr++) {
			for (var Tfr=T[fr], Tsum=0, to=0; to<K; to++) Tsum += Tfr[to];
			//for (var to=0; to<K; to++) piEq[to] += Tfr[to] / Tsum;
			for (var to=0; to<K; to++) {
				//LOG(fr,to,Tsum,dt,Tfr[to]);
				A[fr][to] = ( Tfr[to] / Tsum - ((fr == to) ? 1 : 0) )/dt;
				//A[to][fr] = Tfr[to] / (this.t * this.N);
				// A diag < 0 as these are balanced jump rates
			}
		}
		
		//LOG("eq",Tsum,dt,T);
		
		//for (var to=0; to<K; to++) piEq[to] /= K;
		
	}

	record (ev) {  // record metrics to RAN stream
		if (this.store) 
			this.filter(this.store, ev);
		
		else
			this.ranStream.push(ev);
	}
	
	onBatch (stats) { 
		this.record(["batch",this.t,this.steps, {
			hist: stats,
			state_jumps: this.jumps, 
			coherence_intervals: this.ints, 
			stat_corr: this.gamma[this.steps-1], 
			exp_corr: Math.exp(-this.ints),
			state_times: this.T
		}]);
	}

	onJump (idx,to,from,hold) {  // null to disable
		this.record(["jump",this.t,this.steps,idx,to,from,hold]);
	}

	onStep () {		// null to disable
		this.record(["step",this.t, this.steps]);
	}

	onEnd() {
		LOG("Tc from gamma", this.mleTc, "mle A", this.A); 
		this.record(["end",this.t,this.steps,{corr_time: this.mleTc, mle_jump_rates: this.A} ]);
	}

	pipe(tar, cb) {  // if no cb, stream events to target stream.  if cb, transfer events to target and callback when finished.

		if ( this.store ) {  // in buffering mode
			while (this.steps < this.runSteps) this.start( );
			this.end();
			
			if (cb)
				cb( this.store );
			
			else {
				var n=0, evStream = new STEAM.Readable({
					read: function () {
						this.push( this.store[n++] || null );
					}	
				});
				
				evStream.pipe(tar);
			}
		}

		else 	// in streaming mode
		if (cb) {  // append records to target list
			var tarStream = new STREAM.Writable({
				objectMode: true,
				write: function (ev,en,cb) {
					tar.push(ev);
					cb(null);
				}
			});
				
			this.ranStream.pipe(this.editStream).pipe(tarStream).on("finish", function () {
				cb(tar);
			});
		}
		
		else  // stream records to target stream
			this.ranStream.pipe(this.editStream).pipe(this.charStream).pipe(tar);
	}
		
	config (opts) {  // configure the process
		
		if (opts) Copy(opts, this);
	
		var 
			ran = this,
			N = this.N, A = this.A,
			sqrt = Math.sqrt, floor = Math.floor, rand = Math.random;

		// Define A (jump rate matrix), lambda (average jump rate), and K (number of states) for the desired process
		
		if (A.alpha)  { // two-state markov process via alpha,beta parms
			var 
				alpha = this.alpha = A.alpha, 
				beta = this.beta = A.beta, 
				p = alpha / (alpha + beta), 
				q = 1 - p,
				K = this.K = 2,
				A = this.A = [[-alpha, alpha], [beta, -beta]],
				lambda = this.lambda = avgrate(A),
				pi = this.pi = [p, q];	
		}

		else
		if (A.p)  { // two-state markov process via p,Tc parms
			var
				p = A.p, 
				Tc = A.Tc, 
				q = 1 - p,
				K = this.K = 2,
				alpha = this.alpha = 2.3 * q / Tc, 
				beta = this.beta = 2.3 * p / Tc,
				A = this.A = [[-alpha, alpha], [beta, -beta]],
				lambda = this.lambda = avgrate(A),
				pi = this.pi = [p, q];
		}

		else
		if (dt = A.dt) { // realtime process
			var
				//rt = this.realtime = Copy(A, {}),
				fs = 1/dt,
				fb = fs / this.nyquist,
				n = A.n,
				Tc = 1/fb,
				lambda = this.lambda = 2.3 / Tc,
				K = this.K = ( 1 + sqrt(1+4*n) ) / 2,
				A = this.A = matrix(K,K,0);
		}
		
		else
		if (n = A.n) { // K-state via random rate generator given n = K^2 - K rates
			var 
				K = this.K = ( 1 + sqrt(1+4*n) ) / 2,
				A = this.A = matrix(K,K, function (fr,to,A) {
					A[fr][to] = floor(rand() * 10) + 1;
				}),
				lambda = this.lambda = avgrate(A);

			/*for (var fr=0; fr<K; fr++) 
				for (var to=0; to<K; to++) 
					A[fr][to] = floor(rand() * 10) + 1; */
		}
		
		else
		if (K = this.K = A.K) { // K-state via random rate generator producing n = K^2 - K unique rates
			var 
				n = K*K - K,
				A = this.A = matrix(K,K, function (fr,to,A) {
					A[fr][to] = floor(rand() * 10) + 1;
				}),
				lambda = this.lambda = avgrate(A);

			/*for (var fr=0; fr<K; fr++) 
				for (var to=0; to<K; to++) 
					A[fr][to] = floor(rand() * 10) + 1; */
		}
		
		else {
			var
				K = this.K = A.length,
				lambda = this.lambda = avgrate(A);
		}
		
		// compute (recompute) sampling rate and coherence time

		var 
			n = K*K - K, // number of jump rates
			Tc = this.Tc = 2.3 / lambda, // coherence time
			fb = 1 / Tc, // process bandwidth
			fs = fb * this.nyquist, // sample rate
			dt = this.dt = 1/fs, // sample time
			dint = this.dint = dt / Tc;  // coherence intervals per step
		
		//Trace([n,K,lambda,Tc,this.nyquist,dt]);
		
		if (this.nyquist < 1)
			Trace("Woa there cowboy - your sampling rate is sub Nyquist");

		if ( sym = this.sym ) {  // use supplied state symbols for computing correlations
		}
		
		else {  // default state symbols
			var sym = this.sym = vector(K);
			
			if (K % 2) {
				sym[0]=0;
				for (var a=1, k=1; k<K; a++) {
					sym[k++] = a; 
					sym[k++] = -a;
				}
			}
			else			
				for (var a=1, k=0; k<K; a++) {
					sym[k++] = a; 
					sym[k++] = -a;
				}
		}

		balance(A);  // enforce detailed balance on jump rates
		
		// allocate the ensemble
		
		var 
			//Amle = this.Amle = matrix(K,K),
			R = this.R = matrix(K,K, Tc ? function (fr,to,R) {
					R[fr][to] = (fr == to) ? 0 : 1 / A[fr][to];
				} : 0 ),
			P = this.P = matrix(K,K),
			T = this.T = matrix(K,K,0),
			pi0 = 1/K,
			//piEq = this.piEq = vector(K,pi0),
			pi = this.pi = vector(K,pi0),
			N0 = pi0 * N,
			ZU = this.ZU = matrix(K,K,function (fr,to,Z) {
				Z[fr][to] = (fr == to) ? N0 : 0
			}),
			H = this.H = vector(N),
			NU = this.NU = vector(K),
			U = this.U = vector(N),
			U0 = this.U0 = vector(N),
			WU = this.WU = this.wiener ? vector(N) : [],
			WQ = this.WQ = this.wiener ? vector(N) : [];
		
		//var KU = this.KU = vector(K);

		//LOG("config",pi0,N0,ZU);
		
		/*for (var k=0,pi0=1/K; k<K; k++) {  // default state probabilities
			piEq[k] = pi[k] = pi0;
		}*/
		
		var p = this.p = pi[0], q = this.q = 1 - p;  // intialize activities

		this.t = this.steps = this.ints = this.jumps = this.samples = 0;  // initialize process counters

		/*for (var fr=0; fr<K; fr++)   // intialize state counters
			for (var Tfr=T[fr], Zfr=ZU[fr], to=0; to<K; to++)  
				Zfr[to] = Tfr[to] = 0;  */
		
		if ( this.events ) { // initialize realtime process
			for (var n=0, Np=N*p; n<N; n++) {
				H[n] = 0;
				U0[n] =  (n<Np) ? 1 : 0;
				U[n] = -1; // invalid state value forces jump at first step
				//LOG(n,p,Np,K,U0[n]);
			}
		}
		
		else { // initialize simulated process
			/*
			for (var fr=0; fr<K; fr++) {  
				for (var to=0, Afr=A[fr], Rfr=R[fr]; to<K; to++) {  // compute average holding times
					if ( Tc )
						Rfr[to] = (fr == to) ? 0 : 1/Afr[to];

					else
						Rfr[to] = 0;
				}

				Poisson( dt, fr, P, A );  // seed the ensemble					
			} */

			for (var fr=0; fr<K; fr++) Poisson( dt, fr, P, A );  // initialize cummulative state transition probabilties
			
			//LOG({R:R, P:P});
			
			if (K == 2)  { // initialize two-state process
				for (var n=0, Np=N*p, Ton=R[0][1], Toff=R[1][0]; n<N; n++)  {
					if ( n < Np ) {
						var fr = U0[n] = U[n] = 1;
						var h = H[n] = R[fr][fr] = expdev(Ton);
					}

					else {
						var fr = U0[n] = U[n] = 0;
						var h = H[n] = R[fr][fr] = expdev(Toff);
					}

					//T[fr][fr] += h;
				}
			}

			else  { // initialize K-state process
				for (var n=0; n<N; n++) 
					this.jump( fr = floor(rand() * K), function (to,h) {
						U0[n] = U[n] = fr;
						H[n] = h;	
						//T[fr][fr] += h;
					});
			}

		}
		
		this.corr0 = 0;  // compute initial stat autocov
		for (var k=0; k<K; k++) {  // get symbol variance to normalize correlations
			this.corr0 += sym[k] * sym[k] * pi[k];
		}

		if (this.wiener) {  //  initialilze wiener processes
			this.NRV = RAN.MVN( [0], [[1]] );
			for (var n=0; n<N; n++) WU[n] = WQ[n] = 0;
		}

		/*for (var k=0; k<K; k++) {  // clear cummulative counts in state
			KU[k] = 0;  		
		} */
		
		this.activity = new STATS(this.bins,N);  // initialize ensemble stats
		this.runSteps = floor( this.intervals * this.Tc / this.dt );  // number of steps over specified interval
		
		this.gamma = vector(this.runSteps, 0);  // statistical autocovariance ensemble averaged
		
		// allocate streams (not used with the store is provided)
		
		this.ranStream = new STREAM.Readable({  // source process events from this stream
			objectMode: true,
			read: function () {  // kick-start or terminate the pipe
				LOG("pipe kick",ran.steps, ran.dt, ran.Tc, ran.intervals);
				
				if ( ran.steps < ran.runSteps ) 	// kick start ran.steps
					ran.start( );
				
				else  { // terminate
					ran.end();
					this.push(null);
				}
			}
		});

		this.editStream = new STREAM.Transform({  // process filters events on this stream
			writableObjectMode: true,
			readableObjectMode: true,
			transform: function (ev,en,cb) {
				ran.filter(this,ev);
				cb(null);
			}
		});

		this.charStream = new STREAM.Transform({  // process makes events human readable on this stream
			writableObjectMode: true,
			transform: function (ev,en,cb) {
				this.push( JSON.stringify(ev) ); 
				cb(null);
			}
		});

		Trace({  // display config info
			states: this.K,
			ensemble_size: this.N,		
			coherence_interval: this.intervals, 
			coherence_time: this.Tc,
			nyquist_step_time: this.dt,
			jump_rates: this.A,
			cumTxPr: this.P,
			state_times: this.T,
			hold_times: this.R,
			initial_pr: this.pi,
			coherence_time: this.Tc,
			initial_activity: this.p,
			wiener_walks: this.wiener ? "yes" : "no",
			sample_time: this.dt,
			state_samples: this.ZU,
			avg_rate: this.lambda,
			run_steps: this.runSteps
		});
	}
	
}

// external pkgs
RAN.MVN = require("multivariate-normal").default; // gauss multivariate
RAN.MLE = require("expectation-maximization");  // MLE for mixed gauss ensembles
			
module.exports = RAN;

function STATS(bins,N) {
	this.bins= bins;
	this.dbins= (bins-1) / N;
	this.dcounts= (N-1) / (bins-1);
	this.samples= 0;
	
	var 
		hist = this.hist = vector(bins,0),
		cnt = 1, delta = this.dcounts,
		count = this.count = vector(bins, function (bin,H) {
			H[bin] = Math.round(cnt += delta);
		});

	/*
	for (var cnt=1,bin=0; bin<bins; bin++, cnt+=this.dcounts) {
		hist[bin] = 0;
		count[bin] = Math.round(cnt);
	}*/
}	
	
STATS.prototype.add = function (val) {
	this.hist[ Math.floor( val * this.dbins ) ]++;
	this.samples++;
}

STATS.prototype.norm = function () {
	for (var bin=0, hist=this.hist, bins=this.bins; bin<bins; bin++) hist[bin] /= this.samples * this.dcounts;
}

function expdev(mean) {
	return -mean * Math.log(Math.random());
}

function avgrate(A) {  // A not necessarily balanced

	for (var fr=0,lambda=0,K=A.length; fr<K; fr++)
		for (var to=0,Afr=A[fr]; to<K; to++)
			if ( fr != to ) lambda += Afr[to];

	return lambda / (K*K-K); 	
}
	
function matrix(M,N,cb) {
	var A = new Array(M);
	for (var m=0; m<M; m++) A[m] = new Array(N);
	
	return setmatrix(A,cb);
}

function setmatrix(A,cb) {
	var M = A.length, N = A[0].length;
	
	if (cb != undefined) 
		if (cb.constructor == Function)
			for (var m=0; m<M; m++)
				for (var n=0, Am = A[m]; n<N; n++) cb(m,n,A,Am);
	
		else
		if (cb.constructor == Array)
			for (var m=0; m<M; m++)
				for (var n=0, Am = A[m], B = cb[m]; n<N; n++) Am[n] = B[n];
		
		else
			for (var m=0; m<M; m++)
				for (var n=0, Am = A[m]; n<N; n++) Am[n] = cb;
	
	return A;
}

function vector(N,cb) {
	return setvector(new Array(N),cb);
}

function setvector(A,cb) {	
	var N = A.length;
	if (cb != undefined)
		if (cb.constructor == Function)
			for (var n=0,N=A.length; n<N; n++) cb(n,A);
	
		else
		if (cb.constructor == Array)
			for (var n=0,N=A.length; n<N; n++) A[n] = cb[n];
	
		else
			for (var n=0,N=A.length; n<N; n++) A[n] = cb;
	
	return A;
}	
		
function Poisson( dt, fr , P, A) {  
	var K = P.length;
	for (var to=0,Pfr=P[fr],Afr=A[fr]; to<K; to++) 
		Pfr[to] =  (to == fr) ? 0 : Afr[to]*dt;  // disallows fr-fr jump

	for (var to=1; to<K; to++) Pfr[to] += Pfr[to-1];
	
	var P0 = Pfr[K-1];
	
	if ( P0 ) 
		for (var to=0; to<K; to++) Pfr[to] /= P0;
	else
		for (var to=0; to<K; to++) Pfr[to] = 1;
		
}

function Gillespie( dt, fr, P, R ) {
	var K = P.length;
	for (var to=0,Pfr=P[fr],Rfr=R[fr],R0=Rfr[fr]; to<K; to++) 
		Pfr[to] = (to == fr) ? 0 : Rfr[to] / R0;

	for (var to=1; to<K; to++) Pfr[to] += Pfr[to-1];
	for (var to=0, P0=Pfr[K-1]; to<K; to++) Pfr[to] /= P0;
}

function range (min,max) { // generates a range
	var rtn = new Array(max-min+1);
	for (var n=min,m=0,M=rtn.length; m<=M; m++) rtn[m] = n += 1;
	return rtn;
}	

function balance(A) {   // enforce global balance on jump rates
	var K = A.length;
	for (var fr=0; fr<K; fr++) { 
		for (var to=0, Afr=A[fr], A0=0; to<K; to++)
			A0 += (fr == to) ? 0 : Afr[to];

		Afr[fr] = -A0;
	}
}

